import React, { useState } from 'react';
import axios from 'axios';

type Props = {
    userId: string;
}

const Similarity: React.FC<Props> = (userId) => {
    const [num, setNum] = useState<number>()

    axios.get('http://127.0.0.1:5000/test')
        .then(response => setNum(response.data))

    return (
        <>
         <h2>There are <b>{num}</b>  tweets that contain your bad words</h2>
        </>
    )
}

export default Similarity;
